import Auth from "@/models/Auth";
import axios from "axios";

export default (to, from, next) => {
  try {
    axios.get('validate-token')
  } catch (e) {
    console.log(e);
  }

  if( !Auth.check() ) {
    next({ name: 'login' });
  }
}
